import React from 'react';
import ReactDOM from 'react-dom';
import jsonData from './data/epidemic'

console.log('jsonDate', jsonData);

class Root extends React.Component {
    constructor(props) {
        super(props);
        this.state={
            arr: [1,2,3]
        }
    }
    render() {
        return (
            <Parent>
                <h2 data-name="a" data-index={this.state.arr[0]}>子组件1</h2>
                <h2 data-name="b" data-index={this.state.arr[1]}>子组件2</h2>
                <h2 data-name="c" data-index={this.state.arr[2]}>子组件3</h2>
            </Parent>
        )
    }
}

class Parent extends React.Component {
    constructor(props) {
        super(props);
        this.state={
            arr: [1,2,3]
        }
    }
    render() {
        return (
            <h1>hello</h1>
        )
    }
}

ReactDOM.render(<Root></Root>,document.getElementById('root'));
